style.css:
@-moz-document domain("music.youtube.com") {
body {
    margin: 0;
    background-color: #303030;
}

[dark] ::-webkit-scrollbar, [dark] ::-webkit-scrollbar-corner {
    background: #3E3E3E!important;
}

.center-content.ytmusic-nav-bar {
    box-sizing: border-box;
    position: absolute;
    right: 0;
    display: flex;
    justify-content: center;
    width: 100%;
    height: var(--ytmusic-nav-bar-height);
    padding: 8px 0;
    box-shadow: 0 2px 20px rgba(0, 0, 0, 0.4);
    background-color: #141414;
}

ytmusic-data-bound-header-renderer {
    display: block;
    overflow: hidden;
    background-image: url(data:image/svg+xml;base64,PD94bWwgdmVyc2lvbj0iMS4wIiBlbmNvZGluZz0idXRmLTgiPâ€¦E1LjQtMzENCgkJbDE5LjIsMjguOUwxNzUxLjgsMTIzMS4xeiIvPg0KPC9nPg0KPC9zdmc+DQo=);
    /* background: #141414; */
    padding: var(--ytmusic-nav-bar-height) 0 0;
    margin: 0 0 var(--ytmusic-divider-height);
    --ytmusic-detail-header-renderer-description-width: 640px;
}

ytmusic-browse-response #header ytmusic-data-bound-header-renderer {
    background-image: url(data:image/svg+xml;base64,);
    box-shadow: 0 2px 2px rgba(255, 255, 255, 0.04) inset, 0 0px 10px rgba(0, 0, 0, 0.3);
}

ytmusic-player-bar {
    background-color: #3A3A3A;
}
#player-bar-background.ytmusic-app-layout {
    right: 0;
    background: #3A3A3A;   
    box-shadow: rgba(0, 0, 0, 0.5) 0 0 20px;
}

ytmusic-player-page {
    display: block;
    background-color: #303030;
}

/* Buttons */
ytmusic-data-bound-top-level-menu-item.ytmusic-data-bound-menu-renderer:first-child {
    box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2);
}
yt-button-renderer[is-paper-button] {
    background-color: transparent;
    color: var(--yt-basic-foreground-title-color, var(--yt-spec-text-secondary));
    border-color: var(--yt-basic-foreground-title-color, var(--yt-spec-text-secondary));
}
yt-button-renderer #button.yt-button-renderer {
    color: #fff;
    background-color: #212121;
    text-transform: inherit;
}
.ytmusic-data-bound-top-level-menu-item.ytmusic-data-bound-menu-renderer {
    box-sizing: border-box;
    border: 0;
    border-radius: 2px;
    --yt-paper-button-height: calc(36px - 2px);
    --yt-button-color: #fff;
    --yt-button-background-color: transparent;
    background-color: transparent;
    margin: 0 0 0 16px;
    --yt-button-padding: 6px 12px 6px 12px;
    box-shadow: none;
}
}
